import LoginPage from './Screens/loginPage';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route path='/register'>
          <LoginPage/>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
